    false,nt"url": null,nt"notes": "This is an integrated benthic habitat map
    system which consists of a number of separate map layers including multibeam bathymetry,
    acoustic backscatter imagery, hyperlinked underwater still photographs and/or video
    framegrabs of the benthos, seafloor classification results of living cover and substrate
    from optical imagery, derived depth contours, layers of geomorphic information (slope,
    rugosity, Bathymetric Position Index Structures, and Bathymetric Position Index
    Zones), Ikonos satellite imagery and terrestrial topography where available. These
    data are incorporated into stand alone ArcGIS and ArcReader projects. ArcReader
    is a software package that can be downloaded and installed free of charge, and enables
    the user to view and perform limited manipulations of these map layers.",nt"license_title":
